import React from "react";
import { Link } from 'react-router-dom'

const NotFoundPage = () => {

  const [isAuthenticated, setIsAuthenticated] = useState(true);

  useEffect(() => {
    const accessToken = localStorage.getItem('accessToken');
    const isLogged = !!accessToken; // Double negation to convert truthy/falsy to boolean
    setIsAuthenticated(isLogged)
  }, [isAuthenticated])

  return (
    <div className='page_not_round'>
      {!isAuthenticated ? (
        <>
          <h1>You have already Logged in</h1>
          <Link to="/dashboard">Please go to Dashboard</Link>
        </>
      ) : (
        <>
          <h1>You are not Logged in</h1>
          <Link to="/login">Please Login to continue</Link>
        </>
      )}
    </div>
  )
}

export default NotFoundPage
